// SPDX-License-Identifier: MIT
pragma solidity 0.8.15;

/// @dev Identify the contract to deploy on blockchain network 
/// @dev Each function in this contract dựa vào rule of ERC20 
/// @dev initAsset - The inital amount of asset of each account, due to anable to code the minting action and reward.  
contract Taskcontract {

  int initAsset = 100; 


  event TransferFrom(address sender, address recipient, int amount);

  /// @dev Transaction - The struct of transaction
  /// @param {address} fromAddress - The address of the sender
  /// @param {address} toAddress - The address of the receiver
  /// @param {uint} amount - The amount of asset that transferred
  /// @param {uint} assetOfSender - The amount of asset of the sender, to optimize the caculation

  struct Transaction{
    address fromAddress;
    address toAddress;
    int amount; 
  }

  Transaction[] private transactions; 
  mapping(address => int) private tokenToOwner;

  /// @dev balanceOf - The function to get the balance of asset of each account
  /// @return the balance of messenger sender  
  function balanceOf() external view returns(int){
    int ret = initAsset; 
    for ( uint i = 0; i< transactions.length; i++ ){
      if (transactions[i].toAddress == msg.sender )
        ret += transactions[i].amount; 

      if ( transactions[i].fromAddress == msg.sender )
        ret -= transactions[i].amount; 
    }
    return ret ;
  }


  // {address} _to msg.sender transfer asset to _to 
  // {int} _value amount of asset to transfer 
  // emit the transaction to blockchain flatform 
  /// @dev transferFrom - The function to transfer asset from one account to another
  /// @return success if the transferFrom is successful  
  function transferFrom(address _to, int _value) external returns (bool success) {

    int balance = initAsset;
    for ( uint i = 0; i< transactions.length; i++ ){
      if (transactions[i].toAddress == msg.sender )
        balance += transactions[i].amount; 

      if ( transactions[i].fromAddress == msg.sender )
        balance -= transactions[i].amount; 
    }

    if ( balance <= _value ) return false; 

    if ( _to == msg.sender ) return false;

    transactions.push(Transaction(msg.sender, _to, _value)); 

    emit TransferFrom(msg.sender, _to, _value);

    return true; 
  }


  /// @dev get all transactions of the sender
  /// @return all transactions of the sender, Transaction type 
  function getMyTransactions() external view returns(Transaction[] memory){
    Transaction[] memory temporary = new Transaction[](transactions.length) ; 
    uint counter = 0; 
    for ( uint i = 0; i< transactions.length; i++ ){
      if (transactions[i].toAddress == msg.sender ){
        temporary[counter] = Transaction(msg.sender,transactions[i].fromAddress, transactions[i].amount);
        counter++; 
      } 

      if ( transactions[i].fromAddress == msg.sender ){
        temporary[counter] = Transaction(msg.sender, transactions[i].toAddress, -transactions[i].amount);
        counter++; 
      }
    }
    Transaction[] memory result = new Transaction[](counter);
    for (uint i = 0; i<counter; i++)
      result[i] = temporary[i];
    return result; 
  }
}

